function normalizeDefInfos(defInfos: readonly (tsApi.DefinitionInfo | tsApi.ReferenceEntry)[] | undefined, program: tsApi.Program | undefined) {
    if (!defInfos || !program) {
        return undefined;
    }

    return defInfos.map((info) => {
        const { fileName, textSpan } = info;
        const sourceFile = program.getSourceFile(fileName);
        if (!sourceFile) {
            return info;
        }

        const start = sourceFile.getLineAndCharacterOfPosition(textSpan.start);
        const end = sourceFile.getLineAndCharacterOfPosition(textSpan.start + textSpan.length);

        return `${info.text} [${start.line + 1}, ${start.character + 1} - ${end.line + 1}, ${end.character + 1}]`;
    });
}

